	add("hierophany", "{\"term\":\"hierophany\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) {{l|grc|ἱερος}} {{qualifier|hieros}}, “sacred, holy sign” + {{l|grc|φαίνω}} {{qualifier|phainô}}, “show, appear”.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A physical manifestation of the holy or sacred, serving as a spiritual eidolon for emulation or worship\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027: Robert D. Baird, \u0027Category Formation and the History of Religions\u0027, p75\u0026lt;sup\u0026gt;{1}, {2}, \u0026amp; {3}\u0026lt;/sup\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt;The technical meaning of symbolism is more extensive than the mere assertion that a particular stone or a specific tree is a \u0027\u0027hierophany\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt;Water symbolism involves the common element of water, but lacks a central \u0027\u0027hierophany\u0027\u0027 such as unites lunar symbolism.\u0026lt;sup\u0026gt;59\u0026lt;/sup\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{3}\u0026lt;/sup\u0026gt;But there is, for Eliade, an overarching system which implies a meaning which is more comprehensive than any \u0027\u0027hierophany\u0027\u0027 standing alone, and this system is \u0027implied\u0027 in each particular \u0027\u0027hierophany\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027: Umar Marina Vesci, \u0027Heat and Sacrifice in the Vedas\u0027, p25\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"d) \u0027\u0027\u0027Hierophany\u0027\u0027\u0027 : \u0026lt;nowiki\u0026gt;[\u0026lt;/nowiki\u0026gt;¶\u0026lt;nowiki\u0026gt;]\u0026lt;/nowiki\u0026gt; \u0026lt;br\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"We have now reached the culminating point of the rite. When the fire bursts forth, the \u0027adhvaryu\u0027 rises, takes away the golden lid and announces : “the \u0027gharma\u0027 is aglow” \u0026lt;sup\u0026gt;177\u0026lt;/sup\u0026gt;. This is one of the key-moments of the whole rite, if not its culminating point. The heat has now reached its Zenith, as also the light which is emitted from the fire. It is in fact the heat which guarantees the \u0027\u0027hierophany\u0027\u0027 which at this moment takes place in the \u0027mahāvira\u0027 — in the ‘Great Hero’ — which becomes divine. And it is in this highest degree of incandescence that the Sacred appears with all its force and power, assuring its actual divine presence which the sacrifice — \u0027sacrum facere\u0027 — intends to effect and make manifest\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027: Subrata Kumar Chakrabarti, \u0027Offshore Structure Modeling\u0027, chapter 1 — \u0027\u0027\u0027Hierophany\u0027\u0027\u0027, C\u0026lt;small\u0026gt;HAPTER TITLE\u0026lt;/small\u0026gt;\u0026lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt; \u0026amp; pp7\u0026lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt;, 7–8\u0026lt;sup\u0026gt;{3}\u0026lt;/sup\u0026gt;, and 8\u0026lt;sup\u0026gt;{4}, {5}, \u0026amp; {6}\u0026lt;/sup\u0026gt\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt;[C\u0026lt;small\u0026gt;HAPTER TITLE\u0026lt;/small\u0026gt\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt;I have found it quite impossible, for example, to discuss the sacred and the \u0027coincidentia oppositorum\u0027 without reference to Eliade’s concept of “\u0027\u0027hierophany\u0027\u0027”, and so it is with my attempt to clarify this word that I will begin\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{3}\u0026lt;/sup\u0026gt;Thus a “\u0027\u0027hierophany\u0027\u0027” is a perception of the sacred\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{4}\u0026lt;/sup\u0026gt;Despite the clear, simple definitions quoted above, the passive form of the verb, \u0027phainesthai\u0027, means “to appear”, allowing an interpretation of \u0027\u0027hierophany\u0027\u0027 as an intransitive action by that which is made manifest — \u0027the sacred manifests itself\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{5}\u0026lt;/sup\u0026gt;So, not only are \u0027things\u0027 “transformed” into hierophanies, but \u0027anything\u0027 can be so transformed, and yet, having been so transformed the \u0027\u0027hierophany\u0027\u0027 may remain “cryptic”. Furthermore, “every \u0027\u0027hierophany\u0027\u0027 makes manifest the coincidence of contrary essences” (\u0027Patterns\u0027, 29\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{6}\u0026lt;/sup\u0026gt;As the \u0027Encyclopedia\u0027 goes on to explain, “the appearance of the sacred in a \u0027\u0027hierophany\u0027\u0027, however, does not eliminate its profane existence”\", \"priority\":15}]}, \"synonyms\":{}}");

